import React from 'react';
import './RecValue.css';

const RecValue = props => {
    function renderData() {
        return props.concepts.map(item => (
            <tr key={item.id}>
                <td>{item.name}</td>
                <td>{item.value}</td>
            </tr>
        )
        )
    } 

    if (renderData() === true) {
        return (
            <table>
            <thead>
                <th>Ingredients</th>
                <th>Value</th>
            </thead>
            <tbody>
            {{renderData}}
            </tbody>
            </table>
            
        )
    }
}
export default RecValue;
